This feature requires Anki 2.1.20, or AnkiMobile 2.0.56. AnkiDroid does not currently support this method. To have Anki read the Front field in a US English voice, you can place the following in your card template: {{tts en_US:Front}} On Windows, macOS, and iOS, Anki will use the OS’s built in voices. On Linux, no voices are built in, but voices can be provided by add-ons, such as this one . To see a list of all available languages/voices, place the following on your card template: {{tts-voices:}} If there are multiple voices that support your chosen language, you can specify desired voices in a list, and Anki will choose the first available voice. For example: {{tts ja_JP voices=Apple_Otoya,Microsoft_Haruka:Field}} This would use Otoya when on an Apple device, and Haruka when on a Windows PC. Specifying a different speed is possible in some TTS implementations: {{tts fr_FR speed=0.8:SomeField}} Both speed and voices are optional, but the language must be included. On a Mac, you can customize the available voices: Open the System Preferences screen. Click on Accessibility. Click on Speech. Click on the system voice dropdown, and choose Customize. Some voices sound better than others, so experiment to choose the one you prefer. Please note that the Siri voice can only be used by Apple apps. Once you’ve installed new voices, you’ll need to restart Anki for the new voices to become available. On Windows, some voices like Cortana can not be selected, as Microsoft does not make those voices available to other applications. On a cloze note type, you can make Anki read only the elided sections using the cloze-only filter, like so: {{tts en_US:cloze-only:Text}} The cloze-only filter is supported in Anki 2.1.29+ and AnkiMobile 2.0.65+. You can enable Anki's TTS feature on supported platforms while falling back to AnkiDroid's own method . Until AnkiDroid supports the {{tts:FieldName}} syntax, it will render these fields as text, while other platforms will render a (re)play audio button. In order to temporarily fix this discrepancy between platforms, we can use the following in our templates: <tts service="android" voice="en_US">{{Front}}</tts> <span class="ankitts">{{tts en_US:Front}}</span> <button class="ankidroidTtsButton" onclick="
AnkiDroidJS.ankiTtsSpeak('{{Front}}');">Play TTS</button> Then in the styling section: /*Anki (desktop) TTS needs to be hidden because AnkiDroid currently renders it as text instead of a play button like desktop.*/
.android .ankitts { display: none;
} /*The AnkiDroid tts button won't work on other platforms because it uses the JS API, therefore it should be hidden*/
html:not(.android) .ankidroidTtsButton { display: none;
}

