You can watch a video about styling cards on YouTube. The video shows Anki 2.0’s interface, but the concepts are largely the same. The styling section of the Cards screen can accessed by clicking the "Styling" button next to the "Back Template" button. In that section, you can change the background color of the card, the default font, the text alignment, and so on. The standard options available to you are: font-family The name of the font to use on the card. If your font has spaces in it like "MS Unicode", then you need to surround the font name in double quotes as in this sentence. It is also possible to use multiple fonts on one card; for information on that, please see below. font-size The size of the font in pixels. When changing it, make sure you leave px at the end. text-align Whether the text should be aligned in the center, left, or right. color The color of the text. Simple color names like 'blue', 'lightyellow', and so on will work, or you can use HTML color codes to select arbitrary colors. Please see this webpage for more information. background-color The color of the card background. Any CSS can be placed in the styling section – advanced users may wish to do things like add a background image or gradient, for example. If you’re wondering how to get some particular formatting, please search the web for information about how to do it in CSS, as there is a great deal of documentation available. The styling is shared between all cards, which means that when you make an adjustment it will affect all cards for that note type. It is also possible to specify card-specific styling, however. The following example will use a yellow background on all cards except the first one: .card { background-color: yellow;
}
.card1 { background-color: blue;
}

142.body:
Anki shrinks images to fit the screen by default. You can change this by adding the following to the bottom of your styling section (outside of the default .card { ... }): img { max-width: none; max-height: none;
} AnkiDroid sometimes has trouble scaling images to fit the screen . Setting maximum image dimensions using css should fix this, but seems to be ignored as of AnkiDroid 2.9. A fix is to append !important to each style directive, for example: img { max-width: 300px !important; max-height: 300px !important;
} If you try to change the style for images and find that the star that appears on marked cards is affected (for instance, it becomes way too large), you can target it with the following: img#star { ...;
} You can explore the styling of cards interactively by using Chrome: https://addon-docs.ankiweb.net/porting2.0.html#webview-changes Anki 2.1.50+ supports image resizing within the editor natively.

143.body:
The default styling applies to the whole card. You can also make certain fields or part of the card use a different font, color, and so on. This is particularly important when studying foreign languages, as Anki will sometimes be unable to correctly display characters unless an appropriate font has been chosen. Say you have an “Expression” field, and you want to give it the OSX Thai font “Ayuthaya”. Imagine your template already reads: What is {{Expression}}? {{Notes}} What we need to do is wrap the text we want to style in some HTML. We will put the following in front of the text: <div class=mystyle1> And the following behind it: </div> By wrapping the text like the above, we tell Anki to style the wrapped text with a custom style called “mystyle1”, which we will create later. Thus if we wanted the entire “What is …​?” expression to use the Thai font, we would use: <div class=mystyle1>What is {{Expression}}?</div> {{Notes}} And if we wanted only the expression field itself to use the Thai font, we’d use: What is <div class=mystyle1>{{Expression}}</div>? {{Notes}} After we’ve edited the template, we now need to move to the Styling section between the templates. Before editing it, it should look something like: .card { font-family: arial; font-size: 20px; text-align: center; color: black; background-color: white;
} Add your new style to the bottom, so it looks like: .card { font-family: arial; font-size: 20px; text-align: center; color: black; background-color: white;
} .mystyle1 { font-family: ayuthaya;
} You can include any styling you want in the style. If you wanted to increase the font size too, you’d change the mystyle1 section to look like: .mystyle1 { font-family: ayuthaya; font-size: 30px;
} It’s also possible to bundle custom fonts with your deck, so you don’t need to install them on your computer or mobile device. Please see the installing fonts section for more info.

