Anki defines some special CSS classes that allow you to define different styling for different platforms. The example below shows how to vary the font depending on where you’re reviewing: /* Windows */
.win .example { font-family: "Example1";
}
/* macOS */
.mac .example { font-family: "Example2";
}
/* Linux desktops */
.linux:not(.android) .example { font-family: "Example3";
}
/* both Linux desktops, and Android devices */
.linux .example { font-family: "Example4";
}
/* both Android and iOS */
.mobile .example { font-family: "Example5";
}
/* iOS */
.iphone .example,
.ipad .example { font-family: "Example6";
}
/* Android */
.android .example { font-family: "Example7";
} And in the template: <div class="example">{{Field}}</div> You can also use properties like .gecko, .opera, and .ie to select particular browsers when using AnkiWeb. Please see http://rafael.adm.br/css_browser_selector/ for a full list of options.

