Anki가 우리의 노트를 기반으로 카드를 만들도록 하기 위해서는, 우리는 각 카드의 앞면과 뒷면에 어떤 필드가 표시되어야 할지를 결정하는 형식을 만들어줘야 합니다. 이 형식을 우리는 '카드 타입'이라고 부릅니다. 각 노트 타입은 1개 이상의 카드 타입을 가집니다. 여러분이 노트를 추가하면, Anki는 각 카드 타입에 대해 1개의 카드를 생성할 것입니다. 각 카드타입은 2가지 '템플릿'을 가집니다. 하나는 질문에 대한 것이고, 다른 하나는 정답에 대한 것입니다. 위의 프랑스어 예시에서, 우리는 인식 카드(the recognition card)가 아래처럼 보이길 원했습니다. Q: Bonjour
A: Hello Page #12 이렇게 하려면, 우리는 질문과 정답 템플릿을 다음처럼 설정하면 됩니다: Q: {{French}}
A: {{English}}<br> Page #{{Page}} 필드명을 중괄호로 감싸서, 우리는 Anki에게 해당 영역을 필드에 입력된 실제 정보로 대체하도록 만들 수 있습니다. 중괄호로 감싸지지 않은 부분들은 모두 각 카드에 그대로 남아있습니다. (예를 들어서, 우리는 자료를 추가할 때 "Page #"라는 내용을 페이지 필드에 입력할 필요가 없습니다 - 이 내용은 모든 카드들에 자동으로 추가됩니다.) <br>은 Anki에게 줄바꿈하라고 명령하는 특수코드입니다. 자세한 내용은 템플릿 부분에서 보실 수 있습니다. 인출카드(The production card)의 템플릿도 비슷한 방식으로 작동합니다: Q: {{English}}
A: {{French}}<br> Page #{{Page}} 카드 타입이 한번 만들어지고 나면, 새 노트를 추가할 때마다 해당 카드 타입에 기반해서 1개의 카드가 생성됩니다. 카드 타입은 여러분의 카드를 일관된 형식으로 유지하도록 도와주며, 정보를 추가할 때 들어가는 노력을 크게 줄여줍니다. 또한 카드 타입은 Anki가 연관된 카드들을 서로 너무 가깝게 등장시키지 않도록 해주고, 여러분이 오타나 오류를 고칠 때 연관된 카드 전체를 한번에 수정할 수 있도록 해줍니다. 카드 타입을 추가하거나 수정하고 싶다면, 노트를 추가하거나 수정하는 화면에서 "카드..." 버튼을 누르세요. 카드 타입에 대한 추가적인 정보는 카드와 템플릿 부분을 참고하세요.
